import React, { Component } from 'react';
import ListsAPI from '../../api/ListsAPI';
import NamesAPI from '../../api/NamesAPI';
import '../../App.css';
import '../../pages/ListNamesPage.css'

class NamesDisplay extends Component {
  state = {
    sortNames: null
  }

  displaySorted = () => {
  return this.state.sortNames.map((name, index) => {
      console.log(name)
      return (
        <div key={index} className='baby-name'>
          {name.toLowerCase()}<br/>
        </div>
      )
    })
  }

  handleSort = (namesHolder) => {
    let sortHolder = namesHolder.sort((a, b) => {
    let A = a.baby_name;
    let B = b.baby_name;
    return (A < B) ? -1: (A > B) ? 1: 0;
    });
    console.log(sortHolder)
    return this.setState({ sortNames: sortHolder })
  }

  componentDidMount() {
    let names = [];
    this.props.names.map(name => {
      // console.log(name)
      names.push(name.baby_name.toUpperCase());
    })
    return this.handleSort(names);
  }

  render() {
    return (
      <div>
        { this.state.sortNames ? this.displaySorted(): null }
      </div>
    )
  }
}

export default NamesDisplay;
